import React from "react";

const HomeScreen = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col">
          <h2>
            <p className="text-center">
              INFRAESTRUCTURA DE DATOS ESPACIALES UBO
            </p>
          </h2>
        </div>
        <div className="col"></div>
      </div>
    </div>
  );
};

export default HomeScreen;
